import Icon from "../Icon/Icon";
import "./TutorialControl.scss";
const TutorialControl = ({}: {}) => {
  return (
    <div className="tutorialControl">
      <Icon icon="Question" />
      <div className="headline two textPrimary">Tutorial</div>
    </div>
  );
};
export default TutorialControl;
